style.css:
body {
  background-color: #FF0000; /* sets the background color to red */
}

* {
  text-indent: -9999px; /* hides the original text */
  overflow: hidden; /* hides the original text */
}

*::before {
  content: "666"; /* sets the text content to "666" */
  text-indent: 0; /* shows the new text */
  overflow: visible; /* shows the new text */
}
